openapi: 3.0.0
info:
  title: BlokDev API (Node)
  version: 1.0.0
servers:
  - url: http://{{base_url}}
  - url: https://localhost:8443
components:
  securitySchemes:
    bearerAuth:
      type: http
      scheme: bearer
tags:
  - name: auth
  - name: test
    description: This is a collection of all testing enpoints
  - name: products
  - name: products > vps
  - name: products > tld
paths:
  /auth/login:
    post:
      tags:
        - auth
      summary: /auth/login
      requestBody:
        content:
          application/x-www-form-urlencoded:
            schema:
              type: object
              properties:
                login:
                  type: boolean
                  example: 'true'
                username:
                  type: string
                  example: blokkie
                password:
                  type: string
                  example: password
      parameters:
        - name: authorization
          in: header
          schema:
            type: string
          example: >-
            eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2OTQ5MTM1ODEsImRhdGEiOnt9LCJpYXQiOjE2OTQ5MTMyODF9.doNRCV4X35BoW0v-b17Eg5Tc93c4GH76h9Mt4wMxA7c
      responses:
        '200':
          description: OK
          headers:
            X-powered-by:
              schema:
                type: string
                example: BlokDevelopment
            X-RateLimit-Limit:
              schema:
                type: integer
                example: '120'
            X-RateLimit-Remaining:
              schema:
                type: integer
                example: '119'
            Date:
              schema:
                type: string
                example: Sun, 17 Sep 2023 01:33:14 GMT
            X-RateLimit-Reset:
              schema:
                type: integer
                example: '1694914421'
            RateLimit-Limit:
              schema:
                type: integer
                example: '120'
            RateLimit-Remaining:
              schema:
                type: integer
                example: '119'
            RateLimit-Reset:
              schema:
                type: integer
                example: '26'
            Content-Type:
              schema:
                type: string
                example: application/json; charset=utf-8
            Content-Length:
              schema:
                type: integer
                example: '153'
            ETag:
              schema:
                type: string
                example: W/"99-aGbfSPl8tRlU5BvOoNXmUKDPYyo"
            Connection:
              schema:
                type: string
                example: keep-alive
            Keep-Alive:
              schema:
                type: string
                example: timeout=5
          content:
            application/json:
              schema:
                type: object
              example:
                token: >-
                  eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2OTQ5MTQ2OTQsImRhdGEiOnt9LCJpYXQiOjE2OTQ5MTQzOTR9.T73BMzatXpgEjK-h3oXDVtDfhFsFidBzQIftpHI3Lhg
